// import $ from "jquery";

function clickTesteo(state) {
	console.log( `clicktesteo` );
	const cars = [
		{
			"nombre" : "Saab" ,
		},
		{
			"nombre" : "Volvo" ,
		},
		{
			"nombre" : "BMW" ,
